namespace DDA_2019S2_LWG_FleetManager
{
    /// <summary>
    /// Interaction logic for About.xaml
    /// </summary>
    public partial class About : MetroWindow
    {
        string base64photo = "";
        /// <summary>
        /// constructor for about
        /// </summary>
        public About()
        {
            InitializeComponent();

            byte[] binaryData = Convert.FromBase64String(base64photo);

            BitmapImage BitmapImage = new BitmapImage();
            BitmapImage.BeginInit();
            BitmapImage.StreamSource = new MemoryStream(binaryData);
            BitmapImage.EndInit();

            photo.Source = BitmapImage;
        }
        /// <summary>
        /// this is a click event for close button
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void buttonCloseAbout_Clicked(object sender, RoutedEventArgs e)
        {
            Close();
        }
    }
}
